Description

This week we picked up Kiara Diane. She's 22 years old and already making big waves in the industry even though she's only been doing it for about a year. She's really smoking hot and fit as hell. Kiara used to play softball so she's really athletic and you can tell by her figure. Anyway, Kiara wanted us to hook her up on a blind date, since her last relationship hit the dirt. She's been looking for that male to fill her &quot;void.&quot; So we decided to hook her up with Jessy. He's a sports producer, he does surfing videos mostly and since he travels a lot hasn't had the time to find a girlfriend. Well we hooked up these two to see what would happen. Will these two hook up or will the tide just wash over this next failure...CAN HE SCORE?!
